import styled from  'styled-components'

export const Div = styled.div`
#open{
  background: black;
  color: white;
  border-radius: 1em;
  padding: 5em;
  position: absolute;
  top: 50%;
  left: 50%;
  margin-right: -50%;
  transform: translate(-50%, -50%);
}

  #none{
    display: none;
  }
`
